var riot = require('riot');

riot.tag('emoji-table', '<div>Filter the emoji list</div> <input type="text" placeholder="Search emoji" onkeyup="{ filter }"> <emoji-row each="{items}" size="1em"></emoji-row>', function(opts) {
    var emoji = require("./emoji.json");
    var _ = require('lodash');
        this.items = emoji;
        this.filter = function(e) {
            var search = e.target.value;
            var regex = new RegExp(search, "gi");
            console.log("filtering on", search);
            var results = _.reduce(emoji, function(memo, emoj) {
                if(regex.test(emoj.emoji + emoj.description + emoj.tags.join(' ') + emoj.aliases.join(' '))) {
                    memo.push(emoj);
                }
                return memo;
            }, []);

            console.log("filtering.....", results);
            this.update({ items: results });
        }.bind(this);


    
});

riot.tag('emoji-row', '<div> <span riot-style="font-size: { size }" onclick="{ handleClick }">{ emoji }</span> { description } </div>', function(opts) {
    this.size = opts.size;
    this.handleClick = function(e) {
        console.log("emoji clicked: ", e);
        this.size = this.size === opts.size ? "2em" : opts.size;
    }.bind(this);



});

